import React, { Component } from 'react';

import './App.css';
import './Style/style.css';
// import Routess from './route';

const customeFunction = () => {
  return (
    <div>
      <div>
        <span>input</span>
        <input type="text" />
      </div>
      <input type="submit" value="submit" />

    </div>

  )
}
class App extends Component {
  onClick = () => {
    console.log(this.firstname);
  }
  onKeyUp = (e) => {
    // console.log()
    if (target, e.keyCode === 13) {
      this.lastname.focus()
    }
  }
  render() {
    return (
      <div>
        <div>
          <span>firstname</span>
          <input ref={(input) => { this.firstname = input }}
            onKeyUp={this.onKeyUp.bind(this, 'firstname')}
            type="text" />
        </div>
        <div>
          <span>lastname</span>
          <input type="text" ref={(input) => { this.lastname = input }} onKeyUp={this.onKeyUp.bind(this, 'lastname')} />
        </div>
        <div>
          <span>age</span>
          <input type="text" ref={(input) => { this.age = input }} />
        </div>
        <input type="submit" value="submit" ref={(input) => { this.submit = input }} onClick={this.onClick} />
      </div>
    );
  }
}

export default App;


